import React from 'react';
import '../css/RandomButton.css';

export default () => {

    const onClick = (e) => {
        e.preventDefault();
        let num = Math.floor(Math.random() * Math.floor(10));
        console.log(num);
    };
    

    return(
        <div className='col-sm-12 mt-3'>
            <button className='col-sm-6 btn btn-primary btn-lg RandButt' onClick={onClick}> Randomize </button>
        </div>
    )

}
